import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'
function Home(){
  return (
    <h1>HomePage</h1>
  )
}
function App() {
  return (
    <BrowserRouter>
      <Link to='/'>Home2</Link>
      <Link to='/about'>About</Link>
        <Route exact path="/" component={Home} />
    </BrowserRouter>
  );
}

export default App;
